.wrap {
  height: 100%;
  width: 100%;
  > p {
    font-size: 22px;
  }
}
.box {
  display: flex;
  flex-wrap: wrap;
  height: 100%;
  width: 100%;
  .user {
    min-height: 260px;
    width: 33%;
    border: 1px solid #ccc;
    box-sizing: border-box;
    padding: 0 10px;
    .btn {
      margin: 8px 0;
    }
    span {
      font-size: 14px;
      background: #fff;
      padding: 0 10px;
      border: 1px solid #0139fd;
      color: #0139fd;
      cursor: pointer;
      display: inline-block;
      height: 30px;
      line-height: 30px;
    }

    .updataTit {
      border: 1px solid #ccc;
      color: #ccc;
      margin-left: -1px;
    }
    #blue {
      border: 1px solid #0139fd;
      color: #0139fd;
    }
    #gray {
      border: 1px solid #ccc;
      color: #ccc;
    }
  }
}
